import * as React from "react";
import { Grid, Drawer, AppBar, Toolbar, Typography } from "@mui/material";

type Props = {
  children?: React.ReactNode;
};

const drawerWidth = 60;

export default function PageWrapper({ children }: Props): JSX.Element {
  const [open, setOpen] = React.useState(false);
  return (
    <React.Fragment>
      <Drawer
        sx={{
          marginBottom: "60px",
          width: drawerWidth,
          flexShrink: 0,
          "& .MuiDrawer-paper": {
            width: drawerWidth,
            boxSizing: "border-box",
          },
        }}
        variant="permanent"
        anchor="left"
      ></Drawer>
      <Grid container direction="column">
        <Grid
          item
          xs={12}
          sx={{ height: "60px", borderBottom: "1px solid #E6E6E6" }}
        ></Grid>
        <Grid
          item
          xs={12}
          sx={{ height: "100vh", display: "flex", alignItems: "center" }}
        >
          {children}
        </Grid>
        <Grid
          item
          xs={12}
          sx={{ height: "60px", borderBottom: "1px solid #E6E6E6" }}
        ></Grid>
      </Grid>
    </React.Fragment>
  );
}
